Criswell Embroidery &amp; Design

828 Delicate K-Lace

Two sizes and several variations allow you to create a number of different looks with the designs in this package. Using 60-wt rayon, create dresses in five different lengths, with sleeves or with straps, to fit 11-12&quot; and 15-16&quot; fashion dolls such as Tyler Wentworth, shown here. Files are included for the tiara and earrings, and there is also a pattern for the fabric slip Tyler wears. Additionally, bodice parts in dst and pes formats are combined in one file for large hoops.
